import React,{Component} from 'react';
import AppContainer from './container/AppContainer';
import Map from './components/Map'
import List from './container/ListContainer';
import { GoogleApiWrapper } from 'google-maps-react';

class App extends Component {
  state={
    list:[]
  }
  render(){
  return (
    <AppContainer>  
      <Map 
        centerAroundCurrentLocation={this.props.centerAroundCurrentLocation} google={this.props.google} 
        setLocations ={(list)=>this.setState({list})}/>
      <List list = {this.state.list}/>
    </AppContainer>
    );
  }
}
export default GoogleApiWrapper({
  apiKey: 'AIzaSyCdWkEeqRMNnTrlSmKnCo1WFY7xo6-nKw8'
})(App);
